import React from 'react';
import './App.css';
//import { Link } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <nav>
            <ul className="nav-links">
                <li>Home</li>
                <li>Phonemes</li>
                <li>Morphemes</li>
                <li>Testing</li>
            </ul>
        </nav>
    );
}
export default Nav;
